import {useField} from 'formik'; 
import {
    StyledTextInput,
    StyledLabel,
    StyledIcon
} from './Styles';

import React from 'react';

export const TextInput = ({icon, ...props}) => {
    const [field, meta] = useField(props);

    return (
        <div styled={{position: "relative"}}>
            <StyledLabel htmlFor={props.name}>
                {props.label}
            </StyledLabel>
            <StyledTextInput
                {...field}
                {...props}    

            />
            <StyledIcon>
                {icon}
            </StyledIcon>
        </div>
    )
}
